import React from "react";
import Button from "../components/Button";

class Home extends React.Component {
  state = {
    offers
  };
  render() {
    return (
      <>
        <h1>Home</h1>
        <Button to="offer/1">Lien vers annonces</Button>
      </>
    );
  }
}
export default Home;
